import React from 'react'
import  {connect} from 'react-redux'


export class layout extends React.Component {
  constructor(props){
    super(props)
    
  }

  rendert1(){
      return (this.props.optimized[0]).map((optim, index) => {
        const { step1, step2, step3} = optim //destructuring
         return (
           
            <tr key="t1">
               <td>{step1}</td>
               <td>{step2}</td>
               <td>{step3}</td>
            </tr>
         )
      })
  }

  render() {

    //console.log(this.props.optimized)
    if(!this.props.optimized)return null;
    return (
        <div id="layout">
        <div className="container">
             <h2>Layout</h2>
             <table id = "t1">
               <tbody>
                 {  this.rendert1() }
                 {  this.rendert1() }
               </tbody>
             </table>
             
            <ul id="weekdays">
            <li className= "active">
              M  
            </li>
            <li>
              T  
            </li>
            <li>
              W
            </li>            
            <li>             
             T  
            </li>           
            <li>
            F
            </li>            
            <li>
            S 
            </li>            
            <li>
             S   
            </li> 

            </ul> 

            <div className="list-style">
                  
          </div>
        </div>
        
        <div id = "layout_img">
            
        </div>
        <a className = "layout_labels">LINE 1</a>
        <a className = "layout_labels">LINE 2</a>
        <a className = "layout_labels">LINE 3</a>
        <div id = "layout_img2">
            
        </div>
        <a className = "layout_labels">LINE 4</a>
        <a className = "layout_labels">LINE 5</a>
        <a className = "layout_labels">LINE 6</a>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
  // console.log(state);
  return {
   optimized : state.optimized[0]
  };
};


export default connect(mapStateToProps,null) (layout)
